	<script type="text/javascript"><!--

		var services = '';
		var servicesLabelText = "Available services:"

		function addService(serviceName, serviceURL)
		{
			// no services yet... need to set up box
			if (document.getElementById('services_label').innerHTML == '')
			{
				document.getElementById('services_label').innerHTML = servicesLabelText;
				document.getElementById('services_box').style.visibility = 'visible';
			}

			services += '<div class="serviceLink"><a href="' + serviceURL + '">' + serviceName + '</a></div>';
			document.getElementById('services_box').innerHTML = services;
		}

	//--> </script>
	<link rel="SHORTCUT ICON" href="favicon.ico" />
</head>
<body>

<div class="span_header" id="header_span_header"></div>
<div class="span_body" id="header_span_body">
	<table id="header_table">
		<tr>
			<td id="header_description_cell">
				<h2 id="title"><a href="http://www.apple.com/server/macosx/">Mac OS X Server</a></h2>
				<p id="subtitle">Welcome to your website!</p>
			</td>
			<td id="header_logo_cell"><img src="logo.gif" width="87" height="100" alt="" /></td>
		</tr>
	</table>
</div>
<div class="span_footer" id="header_span_footer"></div>

<div id="column_container">

	<div class="main_column">
		<div class="main_box_header" id="blogs_box_header"></div>
		<div class="main_box_body" id="blogs_box_body">
			<div class="main_box_contents" id="blog_listing_container">
				<div class="index_section" id="main_desc_section">
					<p>This page is just a placeholder. To publish your
					site, place your HTML and image files in the
					following directory:</p>
					<blockquote><p>/Library/WebServer/Documents/</p></blockquote>
					<p>Be sure to name your main page "index.html" and
					it will become the default page for visitors.</p>
				</div>
				<div class="index_section" id="additional_resouces_section">
					<h3>Additional resources</h3>
					<p>For the latest information about Apple Computer,
					Mac OS X Server, and other Apple server products,
					visit:</p>
					<ul>
						<li><a href="http://www.apple.com/">Apple Computer</a></li>
						<li><a href="http://www.apple.com/macosx/server/">Mac OS X Server</a></li>
					</ul>
					<p>Detailed documentation on the Apache web server
					is available:</p>
					<ul>
						<li>In the <a href="http://www.apple.com/server/documentation/">Web Technologies Administration guide</a></li>
						<li>In the Mac OS X Server onscreen help</li>
						<li>In the <a href="http://www.apache.org/docs/">Apache.org</a> on-line documentation</li>
					</ul>
					<p>If you have a question or encounter a problem
					with your server software you can:</p>
					<ul>
						<li>Search the <a href="http://kbase.info.apple.com/">AppleCare Knowledge Base</a></li>
						<li>Visit the <a href="http://www.apple.com/support/macosxserver/webservices/">Apple Support Site</a> for an answer or a workaround</li>
						<li>Join or search the <a href="http://lists.apple.com/">Apple mailing lists</a> for Mac OS X Server, web development, or QuickTime Streaming Server</li>
					</ul>
				</div>
				<p id="copyright_section">&copy; Copyright 2004, 2005 Apple Computer, Inc.</p>
			</div>
		</div>
		<div class="main_box_footer" id="blogs_box_footer"></div>
	</div>

	<div class="side_column">
		<div class="side_box_header" id="calendar_box_header"></div>
		<div class="side_box_body" id="create_blog_body">
			<div class="side_box_contents" id="create_blog_contents">
				<p id="services_label"></p>
				<div id="services_box"></div>
				<div id="poweredbymacosxserver">
					<a href="http://www.apple.com/about/webbadges/" title="Apple Web Badges"><img src="poweredbymacosxserver.gif" width="133" height="31" alt="Powered By Mac OS X Server" /></a>
				</div>
			</div>
		</div>
		<div class="side_box_footer" id="links_box_footer"></div>
	</div>

</div>

<iframe id="weblog_frame" src="/weblog/default/?flavor=include"></iframe>
<iframe id="webmail_frame" src="/webmail/src/"></iframe>

</body>
</html>
